import { Row, Col, Button } from 'react-bootstrap';
import styles from './styles/custom.module.scss'

const SecondSection = () => {
    return (
        <Row className={ `${styles.__Second_Section}` }>
            <br />
            <Col data-aos="fade-right" md={6} className="justify-content-right principalText pt-5">
                <img className="images" src="/imgSecondSection.png" alt="Edufine Image" />
            </Col>
            <Col data-aos="fade-left" md={6} className="principalText row justify-content-center align-items-center pt-5 mt-5">
                <Col md={8}>! Nosotros te podemos ayudar ยก</Col>
            </Col>
        </Row>
    )
}

export default SecondSection
